contracts/KYCERC721Votes.sol.content:
pragma solidity 0.8.17;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Metadata.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/draft-ERC721Votes.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/cryptography/draft-EIP712.sol";
import "./IBalanceOf.sol";

contract KYCERC721Votes is ERC721, ERC721Votes {
    IERC721Metadata public _oldERC721;
    IBalanceOf public _kycToken;

    constructor(IERC721Metadata oldERC721, IBalanceOf kycToken)
        ERC721(oldERC721.name(), oldERC721.symbol())
        EIP712(oldERC721.name(), "1")
    {
        _oldERC721 = oldERC721;
        _kycToken = kycToken;
    }

    function lock(uint256 tokenID, bytes memory data) public {
        _oldERC721.safeTransferFrom(msg.sender, address(this), tokenID, data);

        _safeMint(msg.sender, tokenID);
    }

    function release(uint256 tokenID, bytes memory data) public {
        _burn(tokenID);

        _oldERC721.safeTransferFrom(address(this), msg.sender, tokenID);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenID
    ) internal override {
        require(
            // ignore in case of minting or KYCToken is not set
            from == address(0x0) ||
                address(_kycToken) == address(0x0) ||
                _kycToken.balanceOf(from) > 0,
            "sender doesn't have KYC token"
        );

        require(
            // ignire in case of burning or KYCToken is not set
            to == address(0x0) ||
                address(_kycToken) == address(0x0) ||
                _kycToken.balanceOf(to) > 0,
            "recipient doesn't have KYC token"
        );

        super._beforeTokenTransfer(from, to, tokenID);
    }

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 firstTokenId
    ) internal override(ERC721, ERC721Votes) {
        super._afterTokenTransfer(from, to, firstTokenId);
    }
}

